              className="input--style-1"
              type="text"
              name="Start Date"
              placeholder="mm/dd/yyyy"
              id="input-start"
            />
          </div>
          <div className="input-group input--medium">
            <label className="label">Return Date</label>
            <input
              className="input--style-1"
              type="text"
              name="Return Date"
              placeholder="mm/dd/yyyy"
              id="input-end"
            />
          </div>
          <div>
            <DateRangePicker
